import React, { Component } from 'react'
import Modal from 'react-modal';



const customStyles = {
  content: {
    top: '50%',
    left: '50%',
    right: 'auto',
    bottom: 'auto',
    marginRight: '-50%',
    transform: 'translate(-50%, -50%)',
  },
};
 class Header extends Component {
constructor(){
  super();
  this.state={
    backgroundcolor:'',
    display:'none',
    loginModalIsOPen:false
  }


  handelLogin =()=>{
    this.setState({loginModalIsOPen:true });
  }
  
}




  render() {
    const {backgroundcolor,display,loginModalIsOPen}=this.state
    return (
      <div>
                 <div className="topRedBand">
        <span>
            <div className="logoE">e!</div>
        </span>
       
        <div className="twoButtons">
                <div  className="loginButton" onClick={this.handelLogin}>login</div>
                <div  className="createAccountButton">Create an Account</div>
           </div>
      
    </div>
    <Modal
        isOpen={loginModalIsOPen}
        style={customStyles}
      
      >
       <h2>login</h2>
       <input type="text" placeholder='email'/>
       <input type="text" placeholder='password'/>
       <div>
        <button>login</button>
        <button>cancel</button>
       </div>
      </Modal>
      </div>
    )
  }
}
export default Header
